"Baraclit prefabricated panels are available in different thicknesses (18, 25 or 30 cm), with characteristics of variable fire resistance in accordance with the UNI standard EN 1992-1-2:2005 and with different thermal performances calculated according to UNI EN ISO 10211:2008.
Specifically, they are divided into three categories:
• In solid concrete: for which it is not foreseen no internal insulation;
• Lightened: inside which there is a lightening in expanded polystyrene;
• KlimaWall® series: with total thermal break insulation.
In relation to the KlimaWall® panels, the ""Plus"" and ""Max"" versions are also available, which present two thermal performance alternatives, through the possibility to vary the conductivity characteristic of the internal insulation polystyrene."
